scriptlet.script:
try {
	var sql = "select EAL.INSTANCE,EAL.CUSTOMER,EAL.START_DATE,EL.PROGRAM,EL.SUITE,EL.REGION,EL.MAX_DURATION from ENA_ACTIVE_LABS EAL join ENA_LABS EL on EL.ID = EAL.LAB_ID where EAL.REQUEST = '" + requestId + "'"; 
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

var pr = scriptletContext.get("RS_Previous_Response");
try{
	switch(pr) {
		case "more items":
			if(output.trim().length > 0) {
				//select EAL.INSTANCE,EAL.CUSTOMER,EAL.START_DATE,EL.PROGRAM,EL.SUITE,EL.REGION,EL.MAX_DURATION 
				var enaArray = output.split("|");
				scriptletContext.put("enaArray",JSON.stringify(enaArray));
			}
			scriptletResponse = "more";
		break;

		case "no more items":
			var enaArray = scriptletContext.get("enaArray");
			if(enaArray != undefined) {
				var sn = parseName(enaArray);
				var ed = parseEndDate(enaArray);
				scriptletContext.put("subscriptionName",sn);
				scriptletContext.put("endDate",ed);
				scriptletResponse = "complete";
			}
			else {
				throw new Error("Subscription: " + subscriptionId + " not found in ENA_ACTIVE_LABS");
			}
		break;

		case udefined:
			throw new Error("Datatabse Error:" + output);
		break;
	}
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

function dateInMsToString(lms) {
	//2018-06-21 15:27:11.673
    var date = new Date(lms);
	var year = date.getFullYear();
    var month = date.getMonth() + 1;
    var day = date.getDate();
    var hour = date.getHours();
    var minute = date.getMinutes();
    var second = date.getSeconds();
    var dayformatted = day < 10 ? "0" + day: day;
    var monthformatted = month < 10 ? "0" + month: month;
    var hourFormatted = hour < 10 ? "0" + hour : hour;
    var minuteFormatted = minute < 10 ? "0" + minute : minute;
    var secondFormatted = second < 10 ? "0" + second : second;
    var out = year + "-" + monthformatted + "-" + dayformatted + " " + hourFormatted + ":" + minuteFormatted + ":" + secondFormatted + ".001";
    return out;
}

function parseEndDate(enaArray) {
	var array = JSON.parse(enaArray);
	var start = array[2];
	scriptletContext.put("startDate",start);
	var duration = array[6];
	start = new Date(start);
	var startMS = start.valueOf();
	var endMS = startMS + parseInt(duration)*24*60*60*1000;
	var endDate = dateInMsToString(endMS);
	return endDate; 
}

function parseName(enaArray) {
	var array = JSON.parse(enaArray);
	var instance = array[0];
	var customer = array[1];
	var start = array[2];
	var program = array[3];
	var suite = array[4];
	var region = array[5];
	var duration = array[6];
	var sn = program;
	sn = (suite != "null")? sn.concat("-",suite): (customer!= "null")? sn.concat("-",customer) : sn;
	sn = (region != "null")? sn.concat("-",region): sn;
	sn = sn.concat("-LAB",instance);
	return sn;
}

