	var sql = "update ENA_ACTIVE_LABS set SUBSCRIPTION_NAME = '" + subscriptionName + "', END_DATE = '" + endDate + "' where REQUEST = '" + requestId + "'";
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}
